import React, { useEffect, useState } from "react";
import axios from "axios";

const AdminOrders = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchOrders = async () => {
      try {
        const res = await axios.get(
          "http://localhost:3001/api/adminorders"
        );
        if (res.status === 200) {
          setOrders(res.data.orders);
        } else {
          setError("Failed to fetch orders.");
        }
      } catch (err) {
        setError("An error occurred while fetching orders.");
      } finally {
        setLoading(false);
      }
    };
    fetchOrders();
  }, []);

  if (loading) {
    return (
      <div className="d-flex justify-content-center align-items-center py-5">
        <div className="spinner-border text-primary"></div>
        <span className="ms-2">Loading orders...</span>
      </div>
    );
  }

  if (error) {
    return <p className="text-center text-danger mt-5">{error}</p>;
  }

  return (
    <section className="py-4">
      <h2 className="fw-bold text-center mb-4">All Orders</h2>

      {orders.length === 0 ? (
        <p className="text-center text-muted fs-5">
          No orders found.
        </p>
      ) : (
        <div className="d-flex flex-column gap-4">
          {orders.map((order) => (
            <div key={order.id} className="card">
              {/* Header */}
              <div className="card-header bg-white d-flex justify-content-between align-items-center">
                <div>
                  <div className="fw-bold">Order #{order.id}</div>
                  <small className="text-muted">
                    {order.customer_name} · {order.customer_email}
                  </small>
                </div>

                <span
                  className={`badge ${order.status === "Confirmed"
                      ? "bg-success"
                      : order.status === "Shipped"
                        ? "bg-info text-dark"
                        : order.status === "Delivered"
                          ? "bg-primary"
                          : "bg-secondary"
                    }`}
                >
                  {order.status}
                </span>
              </div>

              {/* Body */}
              <div className="card-body">
                {order.products.map((p, i) => (
                  <div
                    key={i}
                    className="d-flex align-items-center border-bottom pb-2 mb-2"
                  >
                    <img
                      src={`http://localhost:3001/uploads/${p.image}`}
                      alt={p.product_name}
                      className="rounded me-3"
                      style={{
                        width: "55px",
                        height: "55px",
                        objectFit: "cover",
                      }}
                      onError={(e) =>
                        (e.target.src = "/default-product.png")
                      }
                    />

                    <div className="flex-grow-1">
                      <div className="fw-semibold">
                        {p.product_name}
                      </div>
                      <small className="text-muted">
                        ₹{p.price} × {p.qty}
                      </small>
                    </div>

                    <div className="fw-bold text-success">
                      ₹{p.total}
                    </div>
                  </div>
                ))}

                <div className="d-flex justify-content-between align-items-center mt-3">
                  <div>
                    <small className="text-muted">Payment</small>
                    <span
                      className={`badge ms-2 ${order.paymentStatus === "Paid"
                          ? "bg-success"
                          : "bg-warning text-dark"
                        }`}
                    >
                      {order.paymentStatus}
                    </span>
                  </div>

                  <div className="fw-bold text-success fs-6">
                    ₹{order.totalAmount.toFixed(2)}
                  </div>
                </div>
              </div>

              {/* Footer */}
              <div className="card-footer bg-white text-muted small">
                Ordered on{" "}
                {new Date(order.orderDate).toLocaleString("en-IN", {
                  dateStyle: "medium",
                  timeStyle: "short",
                })}
              </div>
            </div>
          ))}
        </div>
      )}
    </section>
  );
};

export default AdminOrders;
